import Box from '../Box';

export default function Whats(){
    return(
        <div className='Whats'>
            <Box titulo='Victor Santos' informacao='Hey there, Im using WhatsApp'/>
            <a href='https://wa.me/55219' target='_blank'><button>Enviar Mensagem</button></a>
        </div>
    )
}
